description:
राष्ट्रिय स्वतन्त्र पार्टी (रास्वपा)का वरिष्ठ नेता बालेन (बालेन्द्र शाह) झापा पुगेका छन् ।

उनी सोमबार बेलुका जहाजमार्फत् काठमाडौंबाट झापा झरेका हुन् ।&amp;nbsp;

बालेन भोलि मंगलबारदेखि चुनावी अभियानमा सक्रिय हुने उनको सचिवालयका एक सदस्यले जानकारी दि

नेपाली कांग्रेसका महामन्त्री प्रदीप पौडेलले कांग्रेस देशको विकासका लागि नेतृत्व लिन तयार रहेको बताएका छन् ।

नागरिकको अपेक्षा अनुसार नै पार्टी सुधारिएको भन्दै उनले अब सुधारिएको नेतृत्वले नै देश विकासको नेतृत्व लिने बताएका हुन् ।&amp;nbsp;

&amp;lsquo

नेपालको कूल विदेशी विनियमको सञ्चिति साढे ३२ खर्ब नाघेको छ ।&amp;nbsp;

चालु आर्थिक वर्षको पुस महिनासम्म देशको कूल विदेशी विनिमय सञ्चिति २१.१ प्रतिशतले बढेर ३२ खर्ब ४२ अर्ब ४५ करोड पुगेको नेपाल राष्ट्र बैंकले सार्वजनिक गरेको तथ्यांकले देखाएको हो ।

